This queue uses two stacks where the `enqueue` operation adds an element to the `in_stack`, and the `dequeue` operation removes an element from the `out_stack`. When the `out_stack` is empty, we transfer all elements from the `in_stack` to the `out_stack`, reversing their order to preserve the FIFO (First-In-First-Out) nature of the queue.
